p.x:
var $bm_rt;
var x, y;
x = transform.position[0];
y = transform.position[1];
$bm_rt = [
    thisComp.layer('Control Setting').effect('Action FX')('Position')[0] + x,
    thisComp.layer('Control Setting').effect('Action FX')('Position')[1] + y
];

s.x:
var $bm_rt;
var s;
s = thisComp.layer('Control Setting').effect('Action FX')('Scale');
$bm_rt = [
    s,
    s
];

v.x:
var $bm_rt;
var range;
$bm_rt = range = thisComp.layer('Control Setting').effect('Action FX')('Pixelate Range');
if (thisComp.layer('Control Setting').effect('Action FX')('on/off') == 1)
    $bm_rt = range;
else
    $bm_rt = 100;
